Actionscript.script:
onClipEvent (load) {
	if (_parent._parent.技能名 == "狂瀑顶")
	{
		子弹属性 = _root.子弹属性初始化(this);

		//以下部分只需要更改需要更改的属性,其余部分可注释掉
		子弹属性.声音 = "狂瀑顶.wav";
		子弹属性.霰弹值 = 1;
		子弹属性.子弹散射度 = 0;
		子弹属性.子弹种类 = "狂瀑顶子弹";

		自机 = _root.获得父节点(this, 2);
		子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.刀属性.power * 4;

		子弹属性.子弹速度 = 40;
		子弹属性.Z轴攻击范围 = 60;
		子弹属性.击倒率 = 1;
		子弹属性.水平击退速度 = 18;
		子弹属性.伤害类型 = "魔法";

		_root.子弹区域shoot传递(子弹属性);
	}
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 3;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战联弹";

	自机 = _root.获得父节点(this,2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 2;
	if(_parent._parent.mp攻击加成){
		子弹属性.子弹威力 += _parent._parent.mp攻击加成;
	}

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 37;
	子弹属性.击倒率 = 1;

    子弹属性.水平击退速度 = 14
	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 3;
	子弹属性.子弹散射度 = 0;
